  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((employeeList) => {
        setEmployeeList(employeeList)
        console.log(employeeList)
      }
        );
  }, []);

  return (
    <div className="App">
      <p>{!employeeList ? "Loading..." : <EmployeeList/>}</p>
    </div>
  );
}

export default App;
